def transpose(m):
    for i in range(len(m)):
        for j in range(len(m[i])):
            if i < j:
                t = m[i][j]
                m[i][j] = m[j][i]
                m[j][i] = t
    return m

def flip(m):
    for i in range(len(m)):
        for j in range(len(m[i])):
            if j < len(m[i]) - j - 1:
                t = m[i][j]
                m[i][j] = m[i][len(m[i]) - j - 1]
                m[i][len(m[i]) - j - 1] = t
    return m

