def think(n, x):
    '''
    >>> think(1, 1)
    0
    >>> think(2, 1)
    0
    >>> think(2, 2)
    0
    >>> think(3, 2)
    1
    >>> think(4, 2)
    1
    >>> think(4, 3)
    1
    >>> think(5, 2)
    1
    >>> think(5, 3)
    2
    >>> think(90, 30)
    29
    '''
    if x == 1 or x == n:
        return 0
    return min([x - 1, n - x])

